package org.frameworkset.bigdata.util;


public class DBJobstatic {

	private String jobname;
	private long savetime;
	 
	private String jobstatic;
	private String jobstaticid;
	public DBJobstatic() {
		// TODO Auto-generated constructor stub
	}
	public String getJobname() {
		return jobname;
	}
	public void setJobname(String jobname) {
		this.jobname = jobname;
	}
	public long getSavetime() {
		return savetime;
	}
	public void setSavetime(long savetime) {
		this.savetime = savetime;
	}
	public String getJobstatic() {
		return jobstatic;
	}
	public void setJobstatic(String jobstatic) {
		this.jobstatic = jobstatic;
	}
	public String getJobstaticid() {
		return jobstaticid;
	}
	public void setJobstaticid(String jobstaticid) {
		this.jobstaticid = jobstaticid;
	}

}
